import { Fragment, useState } from "react"
import '../SignInSignUpPage/SignInSignUpPage.css';

export const SignInSignUpPage = () => {
    const [activeTab, setActiveTab] = useState('Login');

    const renderContent = () => {
        if (activeTab === 'Login') {
            return <Login />;
        } else if (activeTab === 'SignUp') {
            return <SignUp />;
        }
    };

    return (<Fragment>
        <div className="heading-1">
        <a className="link " href="/">Shikshana</a>
        </div>

        <div className="login-container">

            <div className="tabs">
                <button
                    className={`tab ${activeTab === 'Login' ? 'active' : ''}`}
                    onClick={() => setActiveTab('Login')}
                >
                    Login
                </button>
                <button
                    className={`tab ${activeTab === 'SignUp' ? 'active' : ''}`}
                    onClick={() => setActiveTab('SignUp')}
                >
                   SignUp
                </button>
            </div>
            <div className="content">
                {renderContent()}
            </div>
        </div>
    </Fragment>)
}

const Login = () => {
    return (
        <div>
            <h2>Login Page</h2>
            <br/>
            <form className="login-wrapper">
            <label>
                    Login as:
                    <select name="userType">
                    <option value="" disabled>Select user type</option>
                        <option value="student">Student</option>
                        <option value="faculty">Faculty</option>
                    </select>
                </label>
                <br/>
                <label>
                    Email:
                    <input type="email" name="email" required/>
                </label>
                <br/>
                <label>
                    Password:
                    <input type="password" name="password" required/>
                </label>
                <br/>
                <button type="submit">Login</button>
            </form>
        </div>
    )
}

const SignUp = () => {
    const [formData, setFormData] = useState({
        userType: '',
        username: '',
        email: '',
        phone: '',
        password: '',
        reenterPassword: '',
    });
    const [error, setError] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        if (formData.password != formData.reenterPassword){
            setError('Passwords do not match')
        }else{
            setError('');
            return <SignUp />;
        }
    }

    const handleChange = (event) => {
        setFormData({
            ...formData,
            [event.target.name]: event.target.value
        })
    }


    return (

        <div>
            <h2> SignUp</h2>

            <form className="login-wrapper" onSubmit={handleSubmit}>
            <label>
                    SignUp as:
                    <select name="userType" value={formData.userType}>
                        <option value="" disabled>Select user type</option>
                        <option value="student">Student</option>
                        <option value="faculty">Faculty</option>
                    </select>
            </label>
            <br/>
            <label>
                Username:
                <input type="text" name="username" value={formData.username} onChange={handleChange} required/>
            </label>
            <br/>
            <label>
                Email:
                <input type="email" name="email" value={formData.email} onChange={handleChange} required/>
            </label>
            <br/>
            <label>
                Phone Number:
                <input type="tel" name="phone" value={formData.phone} onChange={handleChange}/>
            </label>
            <br/>
            <label>
                Password:
                <input type="password" name="password" value={formData.password} onChange={handleChange} required/>
            </label>
            <br/>
            <label>
                Re-enter Password:
                <input type="password" name="reenterPassword" value={formData.reenterPassword} onChange={handleChange} required/>
            </label>
            <br />
            {error && <p style={{color: 'red'}}>{error}</p>}
            <button type="submit">SignUp</button>
            </form>
        </div>
    )
}
